
def complement(x):
    if x=="A":
        return "T"
    elif x == "C":
        return "G"
    elif x == "G":
        return "C"
    elif x== "T":
        return "A"
    
s = ""
reversed_s = s[::-1]

reverse_complement = ''.join(complement(base) for base in reversed_s)

print(reverse_complement)


